import { useNavigate } from 'react-router-dom'
import { PHButton } from '@src/ui/common/element/muButton'

const PlaycoMain = (props) => {
  return <div {...props}>
    <br/>
    <PHButton onClick={() => navigate(-1)} size='medium'>뒤로 가기</PHButton>
    <PHButton onClick={() => navigate('/')} size='medium'>홈으로 가기</PHButton>
  </div>;
};

export { PlaycoMain };
